export default () => {
  return (
    <div>
      <div className='bg-earth bg-no-repeat bg-fixed min-h-screen flex justify-center items-center'>
        <div className='bg-black bg-opacity-75 rounded-lg p-12'>
          <img className='object-contain float-left w-24' src='/assets/static/iam.jpg' alt='' />
          <p>Lorem ipsum dolor sit, amet consectetur adipisicing elit. Facilis, saepe soluta a dolores explicabo iste cupiditate quos perspiciatis quisquam, libero illo atque ex harum amet deleniti dolorum ab inventore? Similique!
          Quam iusto laboriosam tempore delectus eaque mollitia, nihil ipsa voluptatum rem veniam dolor nobis amet repellat corrupti impedit placeat odit quos quaerat. Nobis obcaecati quia voluptatem. Est quisquam et accusamus.
          Consequatur officiis laborum provident assumenda tempora. Inventore rem reiciendis magni quae sunt nisi tenetur corporis, incidunt repellat, labore veniam qui voluptatem sit voluptates totam. Dolor repudiandae aspernatur qui numquam praesentium?
          Ipsam, incidunt. Distinctio repudiandae excepturi, quisquam soluta odio vero recusandae cumque inventore ea minus est sapiente reiciendis deserunt neque delectus at alias laudantium aliquam aliquid eveniet voluptatibus quia itaque animi?</p>
        </div>
      </div>
      <style jsx>{`
        .bg-earth {
          background-image: url("/assets/static/earth.jpg");
          filter: hue-rotate(135deg) sepia(40%);
        }
      `}</style>
    </div>
  )
}
